'''King Awowogei''' (pronunciation: [[wikipedia:WP:IPA for English|/ˈæ.wə.ˌwoʊ.gi/]] "AH-wuh-woh-ghee") is the powerful [[monkey]] king and monarch of [[Ape Atoll]].

His palace is located south of the [[Temple of Marimbo]] which is in east [[Marim]], the monkey capital. King Awowogei has ape guards blocking the entrance; to get through, talk to the south ape and he will move out of your way. As with the monkeys on Ape Atoll, he is a devoted follower of [[Marimbo]].

Awowogei was [[Awowogei (2021 Birthday event)|one of the party guests]] attending to [[Duke Horacio]]'s party during the [[2021 Birthday event]].

==Quests==
In [[Monkey Madness I]], an adventurer, disguised as a Karamjan monkey, manages to get an audience with Awowogei under the pretense as an ambassador. While he has heard that Karamjan monkeys are inferior to them (since they have no societal structure), he is aware of their resourcefulness. He asks them to rescue another of its kind from the [[Ardougne Zoo]] before considering. When they return with the monkey, he allows them to stay as long as they want while he considers the alliance.

Later on, it is shown that he is secretly working with Glough, who sent him a [[Jungle Demon]] to dispose of the 10th squad.

In [[Monkey Madness II]], he plans another invasion alongside Glough's invasion. He is concerned with Kruk, as Kruk has been consistently late for the recent war meetings. The adventurer finds Kruk in his [[Kruk's Dungeon|dungeon]], kills him, and uses [[Zooknock]]'s powers to masquerade as Kruk. Awowogei reveals that he has recruited the trolls of [[Trollheim]] and ogres of [[Gu'Tanoth]] to a separate invasion, a new war fleet, and Kruk's secret weapon. The adventurer defeats the [[Kob|champ]][[Keef|ions]], destroys the war fleet, and foils the "secret" weapon. When Awowogei hears of this, he dismisses Kruk for his failures and eventually decides on placing [[Duke]] as the head of the ninja monkey guards.

At the end of the quest, he negotiates peace with [[King Narnode Shareen|King Narnode]], stating that Glough would have sent the "two races into their deaths". It is presumed that Awowogei found out what the "secret" weapon was, and was horrified by what Glough had planned to do with his people. He opens the gates of Ape Atoll to all visitors as a result of this new peace treaty.

Awowogei is part of the [[Lumbridge Secret Council]]. During the banquet, he is frozen by the [[Culinaromancer]], but Gypsy Aris saves everyone in time. The adventurer speaks with Awowogei in Ape Atoll in an attempt to find out what his favourite food is, but he refuses to reveal it. They eventually finds out through the three monkeys he mentions that his favourite food is the [[stuffed snake]]. When given to free him from the Culinaromancer's grasp, Awowogei remarks about the tasteful flavors of the snake, and teaches the adventurer the [[Ape Atoll Teleport (standard)|Ape Atoll Teleport]] spell.

==Treasure Trails==
{{Anagram|King Awowogei|hard|WOO AN EGG KIWI}}, with a challenge scroll answer of 24. Those seeking King Awowogei for the anagram clue directed by Hard Clue Scrolls should remember to bring a [[Karamjan monkey greegree]] and an [[M'speak amulet]] to access his building, unless the player has completed Monkey Madness II.

